              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Fashion"} heading={"Trending Fashion"} />
          <div className="grid grid-cols-8 gap-10">
            <FashionCard image={fa1} />
            <FashionCard image={fa2} />
            <FashionCard image={fa3} />
            <FashionCard image={fa4} />
            <FashionCard image={fa5} />
            <FashionCard image={fa6} />
            <FashionCard image={fa4} />
            <FashionCard image={fa5} />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"This month"} heading={"New Arrivals"} />
          <div className="h-80 grid grid-cols-4 gap-4">
            <div className="w-full relative h-full">
              <img
                className="absolute bg-black h-full w-full"
                src={arr1}
                alt=""
              />
              <div className="m-4 absolute text-white bottom-0">
                <h1>Playstation 5</h1>
                <Link className="underline">Shop Now</Link>
              </div>
            </div>
